import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import {Link} from 'react-router-dom'

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Link to="/login/">
        Login
    </Link>
    <App />
  </React.StrictMode>
);
